import React from 'react';
import './About.css';
import { Card, CardHeader, CardBody, CardFooter } from '@chakra-ui/react';

function About() {
  return (
    <div className='about'>
        <Card>
  <CardBody>
    <Text>View a summary of all your customers over the last month.</Text>
  </CardBody>
</Card>
    </div>
  )
}

export default About
